    private List<Integer> solution(String s, String[] words) {
        if (s == null || s.isBlank() || words == null || words.length == 0) {
            return Collections.emptyList();
        }
        var wordArr = new ArrayList<String>();
        var result = new ArrayList<Integer>();

        int shortestWord = 999;
        int longestWord = 0;
        int lookupLength = 0;

        for (int i = 0; i < words.length; i++) {
            wordArr.add(words[i]);
            lookupLength += words[i].length();
            if (words[i].length() < shortestWord) {
                shortestWord = words[i].length();
            }
            if (words[i].length() > longestWord) {
                longestWord = words[i].length();
            }
        }

        for (int i = 0; i < s.length(); i++) {
            var wa = new ArrayList<>(wordArr);
            var startIndex = i;
            var endIndex = startIndex + longestWord;
            var currentIndex = startIndex + shortestWord;
            while (currentIndex <= endIndex && currentIndex <= s.length()) {
                var sub = s.substring(startIndex, currentIndex);
                var idx = wa.indexOf(sub);
                if (idx >= 0) {
                    wa.remove(idx);
                    if (wa.size() == 0) {
                        result.add(i);
                    }
                    startIndex = currentIndex;
                    endIndex = currentIndex + longestWord;
                }
                currentIndex++;
            }

            if (s.length() - i < lookupLength) {
                break;
            }
        }

        return result;
    }

